import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
export default function AddEvent(){
    const navigate = useNavigate();
    const [date, setDate] = useState('');
    const [name, setName] = useState('');
    const [time, setTime] = useState('');
    const [category, setCategory] = useState('');
    const [numVol, setNumVol] = useState('');
    const [location, setLocation] = useState('');
    const [error, setError] = useState('');

    const handleAllEvent = () => {
        navigate('/allevents')
    }

    const handleAssignment = () => {
        //volunteer assignment api
    } 

    const handleSubmit = (event) => {
        event.preventDefault();
        if (date === ''){
            setError('Invalid Email')
        }
        else if (name === ''){
            setError('Invalid Name')
        }
        else if (time === ''){
            setError('Invalid Time')
        }
        else if (category === ''){
            setError('Invalid Position')
        }
        else if (numVol === ''){
            setError('Invalid Position')
        }
        else if (location === ''){
            setError('Invalid Position')
        }
        else{
            navigate('/allevents')
        }
    }

    return(
        <div style={{border: '1px solid black'}}>
            <h1>Add Event</h1>
            <form onSubmit={handleSubmit}>
                <label>
                <p>Name <input type="text" onChange={e => setName(e.target.value)} /></p>
                </label>
                <label>
                <p>Date <input type="date" onChange={e => setDate(e.target.value)} /></p>
                </label>
                <label>
                <p>Time <input type="time" onChange={e => setTime(e.target.value)} /></p>
                </label>
                <label>
                <p>Event category <input type="text" onChange={e => setCategory(e.target.value)} /></p>
                </label>
                <label>
                <p>No. of Volunteers Required <input type="number" onChange={e => setNumVol(e.target.value)} /></p>
                </label>
                <label>
                <p>Location <input type="text" onChange={e => setLocation(e.target.value)} /></p>
                </label>
                <div>
                <button type="submit">Submit</button>
                </div>
                {error && <div>{error}</div>}
            </form>

            <br />
            <div>
                <button onClick={handleAllEvent}>Back to Events List</button>
                <button onClick={handleAssignment}>Assign Volunteers</button>
            </div>
        </div>
    );
}
